Детский отдел осуществляет следующие виды деятельности:
организация фестивалей, смотров, конкурсов, выставок детского и семейного творчества;
осуществление мероприятий по повышению квалификации специалистов культурно-досуговой сферы по вопросам работы с детьми и молодежью;
организация деятельности детского кинозала.
Кружки, студии.
